(13, 4, 'Father is four times the age of his daughter. If after 5 years, he would be threee times of daughterâ€™s age, then further after 5 years, how many times he would be of his daughterâ€™s age?', '1.5', '2', '2.5', '3', 'optionC', 'Father is four times the age of his daughter. If after 5 years, he would be threee times of daughterâ€™s age, then further after 5 years, how many times he would be of his daughterâ€™s age?  '),
(15, 5, 'A man takes 20 minutes to row 12 km upstream which is a third more than the time he takes on his way downstream. What is his speed in still water?', '41 km/hr', '36 km/hr', '42 km/hr', '45 km/hr', 'optionC', 'Let the speed in still water = x km/hr. Takes 20 min. to row 12 km upstream â‡’ speed of u/s = 36 km/hr. Also, time taken for u/s is 1/3 more than for d/s.\r\nâˆ´ distance covered in d / s will be 1/3 more.\r\nHence distance covered by man for d / s in 20 min. = 12 Ã— (12/3) = 16km.\r\nSo speed of d / s = 48 km/hr.\r\nâˆ´ x + y = 48 and x â€“ y = 36 â‡’ x = 42 km/hr.'),
(16, 5, 'How long will it take to row 20 km upstream if one can row 10 km in 10 minutes in still water and the same distance in 8 minutes with the stream?', '12 min', '13.33 min', '24 min', '26.67 min', 'optionD', 'Let x be the speed of man in still water and y be the speed of stream.\r\nâˆ´ Speed of man (x) = 60 km/hr and speed of downstream = 75 km/hr. âˆ´ Speed of stream = 15 km/hr.\r\nHence upstream speed = 60 â€“ 15 = 45 km/hr.\r\nSo time taken to cover 20 km = 20/45*60 = 26.67min.'),
(17, 5, 'A boat makes a return journey from point A to point B and back in 5 hours 36 minutes. One way it travels with the stream and on the return it travels against the stream. If the speed of the stream increases by 2 km/hr, the return journey takes 9 hours 20 minutes. What is the speed of the boat in still water? (The distance between A and B is 16 km.)', '5 km/hr', '3 km/hr', '7 km/hr', '9 km/hr', 'optionC', 'Let x be speed of u / s and y be the speed of d / s.\r\nâˆ´ (16/x) + (16/y) = (28/5) and 16/(y+2) + 16/(x-2) = 28/3\r\nSolving these 2 equations, we get x = 4km/hr and y = 10km/hr\r\nâˆ´ speed of boat in still water = (4+10) / 2 = 7km/hr.'),
(18, 5, ' A boat travels from point A to B, a distance of 12 km. From A it travels 4 km downstream in 15 minutes and the remaining 8 km upstream to reach B. If the downstream speed is twice as high as the upstream speed, what is the average speed of the boat for the journey from A to B?', '10(2/3) km/hr', '9.6 km/hr', '11.16 km/hr', '10.44 km/hr', 'optionB', '4 km downstream is covered in 15 min. âˆ´ speed of downstream = 16 km/hr. So speed of upstream = 8km/hr. Total time taken for downstream journey = 15 min (given). Now total time taken for upstream journey = 8/8 = 1 hr = 60 min. Hence total time taken from A to B = 15 + 60 = 75 min. As average speed = Total distance /total time, so average speed from A to B = (12/75)*60 = 48/5 = 9.6kmph.'),
(19, 5, 'A boat goes 12 km upstream in 48 minutes. The speed of stream is 2 km/hr. The speed of boat in still water is', '15 km/hr', ' 16 km/hr', '17 km/hr', '18 km/hr', 'optionC', '12 km upstream in 48 min. â‡’ it will cover 15 km in 1 hr. Speed of stream = 2 km / hr.\r\nâˆ´ Speed of boat in still water = 15 + 2 = 17 km / hr.'),
(20, 6, 'If a boy starting from Nilesh, met to Ankur and then to Kumar and after this he to Dev and then to Pintu and whole the time he walked in a straight line, then how much total distance did he cover?', '215 m', '155 m', '245 m', '185 m', 'optionA', 'Required distance = 25 m + 40 m + 60 m + 90 m\r\n\r\nRequired distance = 215 m'),
(21, 6, 'Mr Deepak Mohan walks 5 km towards the south and then turns to the right. After walking 3 km he turns to the left and walks 5 km. What direction is he facing right now?', 'West', 'South', 'North-East', 'South-West', 'optionB', '-'),
